import React from 'react'
import {Box,Stack} from "@chakra-ui/react"
import Card from '0Card'

export const Home = () => {
  return (
    // <div>Home hello</div>
    <Box>
        <Stack direction={"row"}>

            <Card amount={5000} img />

        </Stack>
    </Box>
  )
}
